_DESCRIPTION_:
Описание Аккорд-СБ ML-194КЭлектромагнитный замок Аккорд-СБ ML-194К предназначен для использования в системах контроля доступа и автоматики пожарных и запасных выходов, а также в помещениях, где предъявляются самые жесткие требования к исполнительному механизму:высокая надежность;
исключительная износоустойчивость;
вандалозащищенность.Особенностью данного модельного ряда является величина максимального усилия на отрыв, которая составляет не менее 500 кг и большая пропускная способность.
